import * as React from "react";
import Grid from "@mui/material/Grid";
import Box from '@mui/material/Box';

export default function Footer() {
  return (
    <>
      <Grid container>
          <Grid item xs={12}>
      <Box  sx={{ bgcolor: ' #000000', height: '25px'}} />
      </Grid>
      </Grid>
    </>
  );
}
